export class App extends Component {
    constructor() {

        super()


        this.state = {
          
           
            name1: '',
            name2: '',
            sd: [],
            adress:"",
            notes:"",
            age: 0,
            drg:[{}]
        }

    }

    render() {


        return (
            <Context.Provider value={{
                state: this.state,

                actions: {
                   

                    },
                    onChangenote: (value) => {
                        this.setState({
                          notes: value
                        })
                    },
                    onChangenamed: (value) => {
                        this.setState({
                            name1: value
                        })
                    },
                    onChangeage: (value) => {
                        this.setState({
                            age: value
                        })
                    },
                    onChangenamep: (value) => {
                        this.setState({
                            name2: value
                        })
                    },
                    changedItm: (value) => {
                        console.log("value value",value)
                        this.setState({
                            drg: value
                        })
                    },
                    sorting:(e)=>{
                       
                    this.setState({
                  adress:e.target.value
                      })
                    }









            
            }}>

                <React.Fragment>
                    <Header />
                </React.Fragment>
            </Context.Provider>
        )


    }


}



ReactDOM.render(<App />, document.getElementById('root'))
